import React from "react";
import {
  FormControl,
  FormGroup,
  InputLabel,
  Input,
  Typography,
  Button,
  styled,
} from "@mui/material";

const AddUsers = () => {
  return (
    <>
      <FormGroup>
        <Typography>Add User</Typography>

        <FormControl>
          <InputLabel>Name</InputLabel>
          <Input />
        </FormControl>

      </FormGroup>
    </>
  );
};

export default AddUsers;
